		{
		setter.totaltime1.text=minutes.toString()+":0"+seconds.toString();
		}
		else
		{
		setter.totaltime1.text=minutes.toString()+":"+seconds.toString();
		}
		minutes = Math.floor(btotaltime/60);
		seconds = btotaltime - minutes * 60;
		if(seconds<10)
		{
		setter.totaltime2.text=minutes+":0"+seconds;
		}
		else
		{
		setter.totaltime2.text=minutes+":"+seconds;
		}
		
		setter.victoryscore1.text=(Math.round(oscore)).toString();
		setter.victoryscore2.text=(Math.round(bscore)).toString();
			
